import request from '@/utils/request';
export default {
  getList: function getList(params) {
    return request({
      url: '/shop/goods/attr/key/list',
      method: 'get',
      params: params
    });
  },
  save: function save(params) {
    return request({
      url: '/shop/goods/attr/key',
      method: 'post',
      params: params
    });
  },
  remove: function remove(id) {
    return request({
      url: '/shop/goods/attr/key',
      method: 'delete',
      params: {
        id: id
      }
    });
  },
  updateAttrName: function updateAttrName(id, attrName) {
    return request({
      url: '/shop/goods/attr/key/updateAttrName',
      method: 'POST',
      params: {
        id: id,
        attrName: attrName
      }
    });
  }
};
